import React from 'react';

function Nav() {
  return (
    <nav>
        <h3>Logo</h3>
        <ul>
            <li>About</li>
            <li>Services</li>
            <li>Our Projects</li>
            <li>Contact</li>
        </ul>

    </nav>
  );
}

export default Nav;
